// npm start
import React from 'react';
import Header from "./Header.jsx";
import Nav from "./Nav.jsx";
import Main from "./Main.jsx";
import './App.css';


const App = function() {
  return ( 
    <div className="App"> 

      <div className="main"><Main /></div>
      <div className="nav"><Nav /></div>
      <div><Header /></div>
    </div> 
  );
}

export default App;
